  true,\n\t\"url\": null,\n\t\"notes\": \"This data base contains the rotational spectral
  lines observed and reported in the open literature for 55 triatomic molecules through
  June 1976. The isotopic molecular species, assigned quantum numbers, observed frequency,
  estimated measurement uncertainty and reference are given for each transition reported.
  In addition to correcting a number of misprints and errors in the literature cited,
  the spectral lines for approximately 15 molecules have been refit to produce a comprehensive
  and consistent analysis of all the data extracted from various literature sources.
  Both measured and predicted transition frequencies are listed for several isotopic
  forms of HCN, H2O, H2S, and OCS. The derived molecular properties, such as rotational
  and centrifugal distortion constants, hyperfine structure constants, electric dipole
  moments, and rotational g-factors are listed with one standard deviation uncertainty
  for all values.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
